import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Book, Code, PlayCircle, FileText } from 'lucide-react';

const APIDocumentation = () => {
  const { apiId } = useParams();
  const [apiDetails, setApiDetails] = useState(null);

  useEffect(() => {
    // Example function to fetch API details
    const fetchApiDetails = async () => {
      // In a real application, you would fetch the API details from your backend
      // This is just mock data
      const mockApiDetails = {
        'user-api': {
          name: 'User Management API',
          version: 'v2.1.0',
          description: 'Core user management and authentication endpoints',
          endpoints: [
            {
              method: 'GET',
              path: '/api/v2/users',
              description: 'List all users',
              parameters: [
                { name: 'page', type: 'number', description: 'Page number' },
                { name: 'limit', type: 'number', description: 'Items per page' }
              ]
            },
            {
              method: 'POST',
              path: '/api/v2/users',
              description: 'Create a new user',
            }
          ]
        },
        'payment-api': {
          name: 'Payment Processing API',
          version: 'v1.3.2',
          description: 'Payment processing and transaction management',
          endpoints: [
            {
              method: 'POST',
              path: '/api/v1/payments',
              description: 'Process a payment',
            },
            {
              method: 'GET',
              path: '/api/v1/transactions',
              description: 'List all transactions',
            }
          ]
        }
      };

      setApiDetails(mockApiDetails[apiId] || null);
    };

    fetchApiDetails();
  }, [apiId]);

  if (!apiDetails) {
    return (
      <div className="p-6">
        <div className="text-center text-gray-500">Loading API documentation...</div>
      </div>
    );
  }

  return (
    <div className="p-6 space-y-6">
      {/* API Header */}
      <div className="flex justify-between items-start">
        <div>
          <h1 className="text-lg font-semibold text-gray-900">{apiDetails.name}</h1>
          <p className="text-sm text-gray-500">{apiDetails.description}</p>
          <div className="mt-2">
            <span className="px-2.5 py-0.5 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
              {apiDetails.version}
            </span>
          </div>
        </div>
      </div>

      {/* Documentation Content */}
      <div className="space-y-8">
        {/* Endpoints */}
        <div className="bg-white shadow rounded-lg overflow-hidden">
          <div className="px-6 py-4 border-b border-gray-200">
            <h2 className="text-sm font-medium text-gray-900">Endpoints</h2>
          </div>
          <div className="divide-y divide-gray-200">
            {apiDetails.endpoints.map((endpoint, index) => (
              <div key={index} className="p-6">
                <div className="flex items-center space-x-3">
                  <span className={`px-2.5 py-0.5 rounded-full text-xs font-medium
                    ${endpoint.method === 'GET' 
                      ? 'bg-green-100 text-green-800'
                      : 'bg-blue-100 text-blue-800'
                    }`}>
                    {endpoint.method}
                  </span>
                  <code className="text-sm font-mono text-gray-900">{endpoint.path}</code>
                </div>
                <p className="mt-2 text-sm text-gray-500">{endpoint.description}</p>
                
                {endpoint.parameters && endpoint.parameters.length > 0 && (
                  <div className="mt-4">
                    <h4 className="text-xs font-medium text-gray-700 mb-2">Parameters</h4>
                    <div className="bg-gray-50 rounded-md p-4">
                      <div className="space-y-2">
                        {endpoint.parameters.map((param, paramIndex) => (
                          <div key={paramIndex} className="flex items-start">
                            <code className="text-xs font-mono text-gray-900 min-w-[100px]">
                              {param.name}
                            </code>
                            <span className="text-xs text-gray-500 ml-4">
                              {param.description}
                            </span>
                          </div>
                        ))}
                      </div>
                    </div>
                  </div>
                )}
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default APIDocumentation;
